import React, { useState } from 'react';
import CarForm from '../CarForm/CarForm.jsx';
import CarList from '..CarList.jsx';

function CarDetail() {
  const [cars, setCars] = useState([]);

  const addCar = (newCar) => {
    setCars([...cars, newCar]);
  };

  return (
    <div>
      <CarForm onAddCar={addCar} />
      <CarList cars={cars} />
    </div>
  );
}

export default CarDetail;
